import React, { useState } from "react";
import styled from "styled-components";
import FeedTable from "./FeedTable";
import "../style/index.scss";

const StyledContainer = styled.div`
  display: flex;
  align-items: center;
  flex-direction: column;
  min-height: 100vh;
`;

export default () => {
  return (
    <StyledContainer>
      <h2>Tellor Data Feed</h2>
      <FeedTable />
    </StyledContainer>
  );
};
